import { Fragment } from "react";
import { useParams, } from "react-router-dom/cjs/react-router-dom.min";

const QuoteDetails = () => {
  const params = useParams();
  return (
    <Fragment>
      <p>{params.quoteId}</p>
    </Fragment>
  );
};
export default QuoteDetails;
